pragma solidity 0.6.6;

import "@openzeppelin/contracts/math/SafeMath.sol";
// import "@openzeppelin/contracts/access/Ownable.sol";

contract League {

    using SafeMath for uint256;

    struct Team {
        uint256 teamId;
        uint256 amountPaidInWei;
        uint256 amountWonInWei;
    }

    address public commish;
    uint256 public yahooLeagueId;
    uint256 public minBuyInWei;

    mapping(address => Team) public teams;
    mapping(uint256 => address) public teamAddresses;

    constructor(
        address _owner,  
        uint256 _yahooLeagueId, 
        uint256 _minBuyInWei
    ) public {
        commish = _owner;
        yahooLeagueId = _yahooLeagueId;
        minBuyInWei = _minBuyInWei;
    }

    modifier onlyCommish() {
        require(msg.sender == commish, "You're not the commish");
        _;
    }

    function addTeam(uint256 _teamId) payable public {
        require(msg.value >= minBuyInWei, "Not enough Wei");

        Team memory team = Team({
            teamId:_teamId, 
            amountPaidInWei: msg.value, 
            amountWonInWei: 0
        });

        teams[msg.sender] = team;

        // or should it be by yahoo id, so we can pay easier...
        teamAddresses[_teamId] = msg.sender;
    }

    function returnTeam(address _team) public view returns(uint256, uint256, uint256) {
        return (teams[_team].teamId, teams[_team].amountPaidInWei, teams[_team].amountWonInWei);
    }

    // function getAllTeams() public view {

    // }

    function withdrawAllMoney(address payable _to) public onlyCommish {
        _to.transfer(address(this).balance); 
    }

    // receive() external payable {
    //     addTeam();
    // }

    // fallback () external {

    // }
}
